
function siumsee()
  UI("Whitelist", 0,3)
  repeat
    wait()
  until game:IsLoaded()
  wait(3)
  spawn(function()
    while not nil do
      if game.Players.LocalPlayer.Character.Humanoid.sit == true then
        wait(2)
        game.Players.LocalPlayer.Character.Humanoid.Jump = true
      end
    end
  end)
  _G.AutoRejoin = true
  spawn(function()
    while not nil do
      if _G.AutoRejoin then
        getgenv().rejoin = game:GetService("CoreGui").RobloxPromptGui.promptOverlay.ChildAdded:Connect(function(a)
          if a.Name == "ErrorPrompt" and not a and a.MessageArea:FindFirstChild("ErrorFrame") then
            ReJoin()
          end
        end)
      end
    end
  end)
  if _G.Team == "Pirate" then
    for fd, fe in pairs(getconnections(game:GetService("Players").LocalPlayer.PlayerGui.Main.ChooseTeam.Container.Pirates.Frame.ViewportFrame.TextButton.MouseButton1Click)) do
      fe.Function()
    end
  elseif _G.Team == "Marine" then
    for fd, fe in pairs(getconnections(game:GetService("Players").LocalPlayer.PlayerGui.Main.ChooseTeam.Container.Marines.Frame.ViewportFrame.TextButton.MouseButton1Click)) do
      fe.Function()
    end
  else
    for fd, fe in pairs(getconnections(game:GetService("Players").LocalPlayer.PlayerGui.Main.ChooseTeam.Container.Pirates.Frame.ViewportFrame.TextButton.MouseButton1Click)) do
      fe.Function()
    end
  end
  if game:GetService("CoreGui"):FindFirstChild("Discord") then
    game:GetService("CoreGui").Discord:Destroy()
  end
  game:GetService("UserInputService").InputBegan:connect(function(a, b)
    if a.KeyCode == Enum.KeyCode.RightControl then
      wait()
      game:GetService("CoreGui").Discord.Enabled = not game:GetService("CoreGui").Discord.Enabled
    end
  end)
