  function TP(a, b)
    if a - game.Players.LocalPlayer.Character.HumanoidRootPart.Position.Magnitude > 2000 then
      Speed = 220
    else
      Speed = 350
    end
    tweenService, tweenInfo = game:GetService("TweenService"), TweenInfo.new(a - game.Players.LocalPlayer.Character.HumanoidRootPart.Position.Magnitude / Speed, Enum.EasingStyle.Linear)
    tween = tweenService:Create(game:GetService("Players").LocalPlayer.Character.HumanoidRootPart, tweenInfo, {CFrame = b})
    tween:Play()
    _G.Clip = true
    wait(a - game.Players.LocalPlayer.Character.HumanoidRootPart.Position.Magnitude / Speed)
    _G.Clip = false
    if a - game.Players.LocalPlayer.Character.HumanoidRootPart.Position.Magnitude < 100 then
      tween:Cancel()
      game.Players.LocalPlayer.Character.HumanoidRootPart.CFrame = b
    end
  end
