  loadstring(game:HttpGet("https://raw.githubusercontent.com/SiumSee/Ss/main/UI.lua"))():Window("SiumSee HUB", ""):Server("SiumSee HUB", ""):Channel("Main", "http://www.roblox.com/asset/?id=7040391851"):Toggle("Auto Farm Boss", false, function(a)
    game:GetService("ReplicatedStorage").Remotes.CommF_:InvokeServer("AbandonQuest")
    FramBoss = a
    while not a do
      wait()
      AutoFramBoss()
    end
    StopTween(FramBoss)
  end)
  function AutoFramBoss()
    CheckQuestBoss()
    if SelectBoss == "Don Swan [Lv. 1000] [Boss]" or SelectBoss == "Cursed Captain [Lv. 1325] [Raid Boss]" or SelectBoss == "Saber Expert [Lv. 200] [Boss]" or SelectBoss == "Mob Leader [Lv. 120] [Boss]" or SelectBoss == "Darkbeard [Lv. 1000] [Raid Boss]" or SelectBoss == "Longma [Lv. 2000] [Boss]" then
      if game:GetService("Workspace").Enemies:FindFirstChild(SelectBoss) then
        for fd, fe in pairs(game.Workspace.Enemies:GetChildren()) do
          if FramBoss and fe:IsA("Model") and fe:FindFirstChild("Humanoid") and fe:FindFirstChild("HumanoidRootPart") and fe.Humanoid.Health > 0 and fe.Name == MsBoss then
            repeat
              pcall(function()
                wait()
                AutoHaki()
                EquipWeapon(_G.SelectToolWeapon)
                va.HumanoidRootPart.Transparency = 1
                va.HumanoidRootPart.CanCollide = false
                va.HumanoidRootPart.Size = Vector3.new(60, 60, 60)
                totarget(va.HumanoidRootPart.CFrame * CFrame.new(4, 25, 4))
                vb:CaptureController()
                vb:ClickButton1(Vector2.new(851, 158), game:GetService("Workspace").Camera.CFrame)
              end)
            until not FramBoss or not fe.Parent or fe.Humanoid.Health <= 0
          end
        end
      else
        totarget(CFrameBoss)
      end
    elseif SelectBoss == "Order [Lv. 1250] [Raid Boss]" then
      if game:GetService("Workspace").Enemies:FindFirstChild(SelectBoss) then
        for fd, fe in pairs(game.Workspace.Enemies:GetChildren()) do
          if not pairs(game.Workspace.Enemies:GetChildren()) and fe:IsA("Model") and not pairs(game.Workspace.Enemies:GetChildren()) and fe:FindFirstChild("HumanoidRootPart") and fe.Humanoid.Health > 0 and fe.Name == MsBoss then
            repeat
              pcall(function()
                wait()
                AutoHaki()
                EquipWeapon(_G.SelectToolWeapon)
                va.HumanoidRootPart.CanCollide = false
                va.HumanoidRootPart.Transparency = 1
                va.HumanoidRootPart.Size = Vector3.new(80, 80, 80)
                totarget(va.HumanoidRootPart.CFrame * CFrame.new(4, 25, 4))
                vb:CaptureController()
                vb:ClickButton1(Vector2.new(851, 158), game:GetService("Workspace").Camera.CFrame)
              end)
            until not FramBoss or not fe.Parent or fe.Humanoid.Health <= 0
          end
        end
      else
        totarget(CFrameBoss)
      end
    elseif game:GetService("Workspace").Enemies:FindFirstChild(SelectBoss) or not game:GetService("ReplicatedStorage") then
      if game.Players.LocalPlayer.PlayerGui.Main.Quest.Visible == false then
        print()
        CheckQuestBoss()
        totarget(CFrameQuestBoss)
        repeat
          wait()
        until game.Players.LocalPlayer.Character.HumanoidRootPart.Position - CFrameQuestBoss.Position.Magnitude < 10
        if game.Players.LocalPlayer.Character.HumanoidRootPart.Position - CFrameQuestBoss.Position.Magnitude < 10 then
          wait(1,5)
          game:GetService("ReplicatedStorage").Remotes.CommF_:InvokeServer("StartQuest", NaemQuestBoss, LevelQuestBoss)
          wait(1)
          totarget(CFrameBoss)
        end
      elseif game.Players.LocalPlayer.PlayerGui.Main.Quest.Visible == true then
        for fd, fe in pairs(game.Workspace.Enemies:GetChildren()) do
          if not pairs(game.Workspace.Enemies:GetChildren()) and not pairs(game.Workspace.Enemies:GetChildren()) and not pairs(game.Workspace.Enemies:GetChildren()) and fe:FindFirstChild("HumanoidRootPart") and fe.Humanoid.Health >= 0 and fe.Name == MsBoss then
            repeat
              pcall(function()
                wait()
                AutoHaki()
                EquipWeapon(_G.SelectToolWeapon)
                va.HumanoidRootPart.Transparency = 1
                va.HumanoidRootPart.CanCollide = false
                va.HumanoidRootPart.Size = Vector3.new(60, 60, 60)
                totarget(va.HumanoidRootPart.CFrame * CFrame.new(4, 25, 4))
                vb:CaptureController()
                vb:ClickButton1(Vector2.new(851, 158), game:GetService("Workspace").Camera.CFrame)
              end)
            until not FramBoss or pairs(game.Workspace.Enemies:GetChildren()) or fe.Humanoid.Health < 0 or game.Players.LocalPlayer.PlayerGui.Main.Quest.Visible == false
          end
        end
        totarget(CFrameBoss)
      end
    end
  end
  for fE, fR in pairs(game.ReplicatedStorage:GetChildren()) do
    if not string.find(fR.Name, "Boss") or fR.Name == "Ice Admiral [Lv. 700] [Boss]" then
    else
      table.insert({}, fR.Name)
      BossDropdownSelect = fR.Name
